			["customText"] = "function()\n    local DKRune1start, DKRuneDuration,_ = GetRuneCooldown(1)\n    local DKRune2start,_,_ = GetRuneCooldown(2)\n    local DKRune3start,_,_ = GetRuneCooldown(3)\n    local DKRune4start,_,_ = GetRuneCooldown(4)\n    local DKRune5start,_,_ = GetRuneCooldown(5)\n    local DKRune6start,_,_ = GetRuneCooldown(6)\n    \n    local DKRuneTableStart = { \n        DKRune1start, \n        DKRune2start, \n        DKRune3start, \n        DKRune4start,\n        DKRune5start,\n        DKRune6start\n    }\n    \n    table.sort(DKRuneTableStart)\n    \n    --local outp = ''\n    \n    for k,v in pairs(DKRuneTableStart) \n    do\n        --outp = string.format('%s\\n%f   %f', outp, k,DKRuneTableStart[k])\n        local eventname = string.format('WA_event_rune_%.f_byAfreg', k)\n        if DKRuneTableStart[k]>0 then\n            WeakAuras.ScanEvents(eventname, GetTime()-DKRuneTableStart[k],DKRuneDuration, DKRuneTableStart[k]+DKRuneDuration-GetTime())\n        else WeakAuras.ScanEvents(eventname, 1,1, 0)\n        end\n    end\n    return ''\nend",
