			["customText"] = "function()\n    local add_eng = 0            -- starting additional energy\n    local adding_cast_eng = 0    --additional energy per time\n    \n    -- looking for spells, which generates energy\n    local spellName,  _, _, stTime, edTime = UnitCastingInfo(\"player\")\n    if spellName then \n        local spellID = select(7,GetSpellInfo(spellName))\n        for k, v in pairs(aura_env.SpellList) do\n            if v.id == spellID\n            then\n                -- additional enegry with modificator\n                add_eng = v.eng*aura_env.Mod_check()\n            end\n        end\n    else\n        stTime = nil\n        edTime = nil\n    end\n    \n    -- data for spark + editing frame duration if function\n    local min_position, cur_position, max_position, spk_position  = aura_env.E_Position(add_eng, stTime, edTime)\n    WeakAuras.ScanEvents(\"WA_event_engUpdate_by_Afreg\", min_position, cur_position, max_position, spk_position)\n    \n    --duration\n    aura_env.Position = cur_position\n    aura_env.MaxPosition = max_position\n    -- custom text output\n    return string.format('%.f',  UnitPower('player',aura_env.my_energy_type)+add_eng)\nend",
